CREATE DEFINER=`root`@`localhost` FUNCTION `calculate_total_amount_due`(reservation_id INT) RETURNS decimal(10,2)
    DETERMINISTIC
BEGIN
	DECLARE hourly_rate DECIMAL(10,2);
	DECLARE charging_fee DECIMAL(10,2);
	DECLARE num_hours INT;
    DECLARE charging_option VARCHAR(10);
	DECLARE total DECIMAL(10,2);
  
  -- Get hourly rate, charging fee, and number of hours for reservation
	SELECT parking_space.hourly_rate, parking_space.charging_fee_per_hour, reservation.number_of_hours, reservation.charging_option
	INTO hourly_rate, charging_fee, num_hours, charging_option
	FROM parking_space
	JOIN reservation ON reservation.parking_space_id = parking_space.parking_space_id
	WHERE reservation.reservation_id = reservation_id;
  
  -- Calculate total amount due
	SET total = hourly_rate * num_hours;
	IF charging_fee > 0 AND charging_option = 'YES' THEN SET total = total + (charging_fee * num_hours);
	END IF;
  
	RETURN total;
END ;;
